### Describe the issue

Hi, I am getting wrong result when I try to run the below java code. I get gibberish result like "[J@ba1f559". Am I messing up something in my code?

### To reproduce

# Inference Code

package src.main.java.ml;

import ai.onnxruntime.OnnxTensor;
import ai.onnxruntime.OrtEnvironment;
import ai.onnxruntime.OrtException;
import ai.onnxruntime.OrtSession;

import java.util.HashMap;
import java.util.Map;

import static javax.swing.UIManager.put;

public class BaseModelONNX {

    private final OrtEnvironment env;
    private final OrtSession session;

    public BaseModelONNX() throws OrtException {
        this.env = OrtEnvironment.getEnvironment();
        this.session = env.createSession("/Users/vedparanjape/code/vehicle-search-msvc/vehicle-search-server/src/main/resources/onnxml/ml-models/pipeline_rf.onnx", new OrtSession.SessionOptions());
    }

    public void pred() throws OrtException {

        float[][] sourceArray = new float[1][1];
        OnnxTensor tensor = OnnxTensor.createTensor(env,sourceArray);
        Map<String, OnnxTensor> inputs = new HashMap();
        inputs.put("sepal_length",tensor);
        inputs.put("sepal_width",tensor);
        inputs.put("petal_length",tensor);
        inputs.put("petal_width",tensor);

        System.out.println(session.run(inputs).get(0).getValue());
    }

}

# Training Code
import numpy
from sklearn.datasets import load_iris
from sklearn.pipeline import Pipeline
from sklearn.preprocessing import StandardScaler
from sklearn.ensemble import RandomForestClassifier

data = load_iris()
X = data.data[:, :4]
y = data.target

ind = numpy.arange(X.shape[0])
numpy.random.shuffle(ind)
X = X[ind, :].copy()
y = y[ind].copy()

pipe = Pipeline([('scaler', StandardScaler()),
                ('clr', RandomForestClassifier())])
pipe.fit(X, y)

from skl2onnx import convert_sklearn
from skl2onnx.common.data_types import FloatTensorType

options = {id(pipe): {'zipmap': False}}

initial_types = [
   ('sepal_length', FloatTensorType([None, 1])),
   ('sepal_width', FloatTensorType([None, 1])),
   ('petal_length', FloatTensorType([None, 1])),
   ('petal_width', FloatTensorType([None, 1])),
]

model_onnx = convert_sklearn(
   pipe, 'pipeline_rf', initial_types=initial_types, options=options
)

with open('pipeline_rf.onnx', 'wb') as f:
 f.write(model_onnx.SerializeToString())

